    #[derive(Default, Debug, Eq, PartialEq)]
    struct Elf {
        calories: Vec<i32>,
    }

    impl PartialOrd for Elf {
        fn partial_cmp(&self, other: &Self) -> Option<Ordering> {
            Some(self.cmp(other))
        }
    }

    impl Ord for Elf {
        fn cmp(&self, other: &Self) -> Ordering {
            self.calories
                .iter()
                .sum::<i32>()
                .cmp(&other.calories.iter().sum::<i32>())
        }
    }

    let mut elves: Vec<Elf> = vec![Elf::default()];

    for i in input.iter() {
        match i {
            Some(x) => elves.last_mut().unwrap().calories.push(*x),
            None => elves.push(Elf::default()),
        }
    }

    let mut totals: Vec<i32> = elves.iter().map(|x| x.calories.iter().sum::<i32>()).collect();
    totals.sort();

    // let res = totals.first().unwrap();

    let res: i32 = totals.iter().rev().take(3).fold(0,|acc,x| acc + x);
    
